import { useCallback, useEffect } from 'react';
import { View } from 'react-native';

export default function Game({level}) {

    const init = useCallback(()=> {
            console.log(level)
    }, [level]);

    useEffect(init, [level]);
    return (
        <View>
            {level}
        </View>
    );
}
